void ForwardKinematic()
{
	unsigned char i,j;
	unsigned int LoopNum=0;
	double err;
	var_t diff_var;

	diff_var.alpha = 0;
	diff_var.beta = 0;
	diff_var.gama = 0;
	diff_var.X0 = 0;
	diff_var.Y0 = 0;
	diff_var.Z0 = 0;

	PrintVarStruct(var,varq);

	// matrix *OriMatrix,*InvMartix;
	// OriMatrix = makeMatrix(6,6);	//为matrix申请内存空间 
	Matrix_t InvMartix,OriMatrix;

	// OriMatrix->height = 6;
    // OriMatrix->width = 6;
    // OriMatrix->data = J[0];
   
	// varq.q1 = 281;  varq.q2 = 291; varq.q3 = 291;
	// varq.q1 = 234.93;  varq.q2 = 289.5438; varq.q3 = 275.6786;
	// varq.q1 = 271.13;  varq.q2 = 285.917; varq.q3 = 313.634;
	err = 1;
	while(err>0.0000001)
	{	
		var.alpha += diff_var.alpha;
		var.beta += diff_var.beta;
		var.gama += diff_var.gama;
		var.X0 += diff_var.X0;
		var.Y0 += diff_var.Y0;
		var.Z0 += diff_var.Z0;

		while(var.alpha<-pi)	{
			var.alpha +=pi;
		}
		while(var.alpha>pi)	{
			var.alpha -=pi;
		}
		while(var.beta<-pi)	{
			var.beta +=pi;
		}
		while(var.beta>pi)	{
			var.beta -=pi;
		}
		while(var.gama<-pi)	{
			var.gama +=pi;
		}
		while(var.gama>pi)	{
			var.gama -=pi;
		}
		Jacobian(var);
		for(i=0;i<36;i++)
		{
			OriMatrix.data[i] = J[(char)(i/6)][i%6];
		}
		OriMatrix.height = 6;
		OriMatrix.width = 6;
		// OriMatrix.data = J[0];
		// printMatrix(OriMatrix);
		//输出原始数据
		PrintVarStruct(var,varq);

		InvMartix = m_inverseMatrix(OriMatrix);
		// printDAta(InvMartix.data,36);
		for(i=0;i<36;i++)	
		{
			// if(i%6==0)
			// 	printf("\n");
			// printf("%6.3f  ",InvMartix.data[i]);
			InvJ[(char)(i/6)][i%6] = (double)InvMartix.data[i];
			
			
		}
		err = Relation(var,&diff_var,varq);
		PrintVarStruct(diff_var,varq);
		printf(" err = %18.12f  \n",err);
		LoopNum++;
	}
	// printf("Over\n");
	// printf("%d\n",LoopNum);
	// freeMatrix(OriMatrix);
	// freeMatrix(InvMartix);
	#ifdef DebugPrint
		PrintVarStruct(var,varq); 
		printf("The Loop time is %d \n",LoopNum);
	#endif

}
signed char sign(double k)
{
	if(k>0)
		return 1;
	else if (k==0)
		return 0;
	else
		return -1;
}

