	Fi[0] = pow((Y0 + b - a*(cos(alpha)*cos(gama) - sin(alpha)*sin(beta)*sin(gama)) + (40*sqrt(3)*a*(cos(alpha)*sin(gama) + cos(gama)*sin(alpha)*sin(beta)))/sqrt(3*pow(fabs(a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha))),2) + 3*pow(fabs(a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama))),2) + 3*pow(fabs(a*cos(beta)*cos(gama)),2))),2) + pow((X0 + a*cos(beta)*sin(gama) + (40*sqrt(3)*a*cos(beta)*cos(gama))/sqrt(3*pow(fabs(a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha))),2) + 3*pow(fabs(a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama))),2) + 3*pow(fabs(a*cos(beta)*cos(gama)),2))),2) + pow((Z0 - a*(cos(gama)*sin(alpha) + cos(alpha)*sin(beta)*sin(gama)) + (40*sqrt(3)*a*(sin(alpha)*sin(gama) - cos(alpha)*cos(gama)*sin(beta)))/sqrt(3*pow(fabs(a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha))),2) + 3*pow(fabs(a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama))),2) + 3*pow(fabs(a*cos(beta)*cos(gama)),2)) - 20),2) - pow(q1,2) - 1600;
	Fi[1] = pow((a*(cos(gama)*sin(alpha) + cos(alpha)*sin(beta)*sin(gama)) - Z0 + (40*sqrt(3)*a*(sin(alpha)*sin(gama) - cos(alpha)*cos(gama)*sin(beta)))/sqrt(3*pow(fabs(a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha))),2) + 3*pow(fabs(a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama))),2) + 3*pow(fabs(a*cos(beta)*cos(gama)),2)) + 20),2) + pow((Y0 + b - a*(cos(alpha)*cos(gama) - sin(alpha)*sin(beta)*sin(gama)) - (40*sqrt(3)*a*(cos(alpha)*sin(gama) + cos(gama)*sin(alpha)*sin(beta)))/sqrt(3*pow(fabs(a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha))),2) + 3*pow(fabs(a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama))),2) + 3*pow(fabs(a*cos(beta)*cos(gama)),2))),2) + pow((X0 + a*cos(beta)*sin(gama) - (40*sqrt(3)*a*cos(beta)*cos(gama))/sqrt(3*pow(fabs(a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha))),2) + 3*pow(fabs(a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama))),2) + 3*pow(fabs(a*cos(beta)*cos(gama)),2))),2) - pow(q1,2) - 1600;
	Fi[2] = pow((Z0 - (40*((3*a*(cos(gama)*sin(alpha) + cos(alpha)*sin(beta)*sin(gama)))/2 - (sqrt(3)*a*(sin(alpha)*sin(gama) - cos(alpha)*cos(gama)*sin(beta)))/2))/sqrt(pow(fabs((3*a*cos(beta)*sin(gama))/2 + (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow(fabs((3*a*(cos(gama)*sin(alpha) + sin(beta)*cos(alpha)*sin(gama)))/2 - (sqrt(3)*a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama)))/2),2) + pow(fabs((3*a*(cos(alpha)*cos(gama) - sin(beta)*sin(alpha)*sin(gama)))/2 - (sqrt(3)*a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha)))/2),2)) + (a*(cos(gama)*sin(alpha) + cos(alpha)*sin(beta)*sin(gama)))/2 + (sqrt(3)*a*(sin(alpha)*sin(gama) - cos(alpha)*cos(gama)*sin(beta)))/2 - 20),2) - pow(q2,2) + pow((X0 - (sqrt(3)*b)/2 + (40*((3*a*cos(beta)*sin(gama))/2 + (sqrt(3)*a*cos(beta)*cos(gama))/2))/sqrt(pow(fabs((3*a*cos(beta)*sin(gama))/2 + (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow(fabs((3*a*(cos(gama)*sin(alpha) + sin(beta)*cos(alpha)*sin(gama)))/2 - (sqrt(3)*a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama)))/2),2) + pow(fabs((3*a*(cos(alpha)*cos(gama) - sin(beta)*sin(alpha)*sin(gama)))/2 - (sqrt(3)*a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha)))/2),2)) - (a*cos(beta)*sin(gama))/2 + (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow((Y0 - b/2 - (40*((3*a*(cos(alpha)*cos(gama) - sin(alpha)*sin(beta)*sin(gama)))/2 - (sqrt(3)*a*(cos(alpha)*sin(gama) + cos(gama)*sin(alpha)*sin(beta)))/2))/sqrt(pow(fabs((3*a*cos(beta)*sin(gama))/2 + (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow(fabs((3*a*(cos(gama)*sin(alpha) + sin(beta)*cos(alpha)*sin(gama)))/2 - (sqrt(3)*a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama)))/2),2) + pow(fabs((3*a*(cos(alpha)*cos(gama) - sin(beta)*sin(alpha)*sin(gama)))/2 - (sqrt(3)*a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha)))/2),2)) + (a*(cos(alpha)*cos(gama) - sin(alpha)*sin(beta)*sin(gama)))/2 + (sqrt(3)*a*(cos(alpha)*sin(gama) + cos(gama)*sin(alpha)*sin(beta)))/2),2) - 1600;
	Fi[3] = pow((Z0 + (40*((3*a*(cos(gama)*sin(alpha) + cos(alpha)*sin(beta)*sin(gama)))/2 - (sqrt(3)*a*(sin(alpha)*sin(gama) - cos(alpha)*cos(gama)*sin(beta)))/2))/sqrt(pow(fabs((3*a*cos(beta)*sin(gama))/2 + (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow(fabs((3*a*(cos(gama)*sin(alpha) + sin(beta)*cos(alpha)*sin(gama)))/2 - (sqrt(3)*a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama)))/2),2) + pow(fabs((3*a*(cos(alpha)*cos(gama) - sin(beta)*sin(alpha)*sin(gama)))/2 - (sqrt(3)*a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha)))/2),2)) + (a*(cos(gama)*sin(alpha) + cos(alpha)*sin(beta)*sin(gama)))/2 + (sqrt(3)*a*(sin(alpha)*sin(gama) - cos(alpha)*cos(gama)*sin(beta)))/2 - 20),2) + pow(((sqrt(3)*b)/2 - X0 + (40*((3*a*cos(beta)*sin(gama))/2 + (sqrt(3)*a*cos(beta)*cos(gama))/2))/sqrt(pow(fabs((3*a*cos(beta)*sin(gama))/2 + (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow(fabs((3*a*(cos(gama)*sin(alpha) + sin(beta)*cos(alpha)*sin(gama)))/2 - (sqrt(3)*a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama)))/2),2) + pow(fabs((3*a*(cos(alpha)*cos(gama) - sin(beta)*sin(alpha)*sin(gama)))/2 - (sqrt(3)*a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha)))/2),2)) + (a*cos(beta)*sin(gama))/2 - (sqrt(3)*a*cos(beta)*cos(gama))/2),2) - pow(q2,2) + pow((Y0 - b/2 + (40*((3*a*(cos(alpha)*cos(gama) - sin(alpha)*sin(beta)*sin(gama)))/2 - (sqrt(3)*a*(cos(alpha)*sin(gama) + cos(gama)*sin(alpha)*sin(beta)))/2))/sqrt(pow(fabs((3*a*cos(beta)*sin(gama))/2 + (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow(fabs((3*a*(cos(gama)*sin(alpha) + sin(beta)*cos(alpha)*sin(gama)))/2 - (sqrt(3)*a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama)))/2),2) + pow(fabs((3*a*(cos(alpha)*cos(gama) - sin(beta)*sin(alpha)*sin(gama)))/2 - (sqrt(3)*a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha)))/2),2)) + (a*(cos(alpha)*cos(gama) - sin(alpha)*sin(beta)*sin(gama)))/2 + (sqrt(3)*a*(cos(alpha)*sin(gama) + cos(gama)*sin(alpha)*sin(beta)))/2),2) - 1600;
	Fi[4] = pow((b/2 - Y0 + (40*((3*a*(cos(alpha)*cos(gama) - sin(alpha)*sin(beta)*sin(gama)))/2 + (sqrt(3)*a*(cos(alpha)*sin(gama) + cos(gama)*sin(alpha)*sin(beta)))/2))/sqrt(pow(fabs((3*a*cos(beta)*sin(gama))/2 - (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow(fabs((3*a*(cos(gama)*sin(alpha) + sin(beta)*cos(alpha)*sin(gama)))/2 + (sqrt(3)*a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama)))/2),2) + pow(fabs((3*a*(cos(alpha)*cos(gama) - sin(beta)*sin(alpha)*sin(gama)))/2 + (sqrt(3)*a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha)))/2),2)) - (a*(cos(alpha)*cos(gama) - sin(alpha)*sin(beta)*sin(gama)))/2 + (sqrt(3)*a*(cos(alpha)*sin(gama) + cos(gama)*sin(alpha)*sin(beta)))/2),2) + pow(((40*((3*a*(cos(gama)*sin(alpha) + cos(alpha)*sin(beta)*sin(gama)))/2 + (sqrt(3)*a*(sin(alpha)*sin(gama) - cos(alpha)*cos(gama)*sin(beta)))/2))/sqrt(pow(fabs((3*a*cos(beta)*sin(gama))/2 - (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow(fabs((3*a*(cos(gama)*sin(alpha) + sin(beta)*cos(alpha)*sin(gama)))/2 + (sqrt(3)*a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama)))/2),2) + pow(fabs((3*a*(cos(alpha)*cos(gama) - sin(beta)*sin(alpha)*sin(gama)))/2 + (sqrt(3)*a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha)))/2),2)) - Z0 - (a*(cos(gama)*sin(alpha) + cos(alpha)*sin(beta)*sin(gama)))/2 + (sqrt(3)*a*(sin(alpha)*sin(gama) - cos(alpha)*cos(gama)*sin(beta)))/2 + 20),2) - pow(q3,2) + pow((X0 + (sqrt(3)*b)/2 + (40*((3*a*cos(beta)*sin(gama))/2 - (sqrt(3)*a*cos(beta)*cos(gama))/2))/sqrt(pow(fabs((3*a*cos(beta)*sin(gama))/2 - (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow(fabs((3*a*(cos(gama)*sin(alpha) + sin(beta)*cos(alpha)*sin(gama)))/2 + (sqrt(3)*a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama)))/2),2) + pow(fabs((3*a*(cos(alpha)*cos(gama) - sin(beta)*sin(alpha)*sin(gama)))/2 + (sqrt(3)*a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha)))/2),2)) - (a*cos(beta)*sin(gama))/2 - (sqrt(3)*a*cos(beta)*cos(gama))/2),2) - 1600;
	Fi[5] = pow((Z0 + (40*((3*a*(cos(gama)*sin(alpha) + cos(alpha)*sin(beta)*sin(gama)))/2 + (sqrt(3)*a*(sin(alpha)*sin(gama) - cos(alpha)*cos(gama)*sin(beta)))/2))/sqrt(pow(fabs((3*a*cos(beta)*sin(gama))/2 - (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow(fabs((3*a*(cos(gama)*sin(alpha) + sin(beta)*cos(alpha)*sin(gama)))/2 + (sqrt(3)*a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama)))/2),2) + pow(fabs((3*a*(cos(alpha)*cos(gama) - sin(beta)*sin(alpha)*sin(gama)))/2 + (sqrt(3)*a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha)))/2),2)) + (a*(cos(gama)*sin(alpha) + cos(alpha)*sin(beta)*sin(gama)))/2 - (sqrt(3)*a*(sin(alpha)*sin(gama) - cos(alpha)*cos(gama)*sin(beta)))/2 - 20),2) + pow(((40*((3*a*cos(beta)*sin(gama))/2 - (sqrt(3)*a*cos(beta)*cos(gama))/2))/sqrt(pow(fabs((3*a*cos(beta)*sin(gama))/2 - (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow(fabs((3*a*(cos(gama)*sin(alpha) + sin(beta)*cos(alpha)*sin(gama)))/2 + (sqrt(3)*a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama)))/2),2) + pow(fabs((3*a*(cos(alpha)*cos(gama) - sin(beta)*sin(alpha)*sin(gama)))/2 + (sqrt(3)*a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha)))/2),2)) - (sqrt(3)*b)/2 - X0 + (a*cos(beta)*sin(gama))/2 + (sqrt(3)*a*cos(beta)*cos(gama))/2),2) - pow(q3,2) + pow((Y0 - b/2 + (40*((3*a*(cos(alpha)*cos(gama) - sin(alpha)*sin(beta)*sin(gama)))/2 + (sqrt(3)*a*(cos(alpha)*sin(gama) + cos(gama)*sin(alpha)*sin(beta)))/2))/sqrt(pow(fabs((3*a*cos(beta)*sin(gama))/2 - (sqrt(3)*a*cos(beta)*cos(gama))/2),2) + pow(fabs((3*a*(cos(gama)*sin(alpha) + sin(beta)*cos(alpha)*sin(gama)))/2 + (sqrt(3)*a*(sin(alpha)*sin(gama) - sin(beta)*cos(alpha)*cos(gama)))/2),2) + pow(fabs((3*a*(cos(alpha)*cos(gama) - sin(beta)*sin(alpha)*sin(gama)))/2 + (sqrt(3)*a*(cos(alpha)*sin(gama) + sin(beta)*cos(gama)*sin(alpha)))/2),2)) + (a*(cos(alpha)*cos(gama) - sin(alpha)*sin(beta)*sin(gama)))/2 - (sqrt(3)*a*(cos(alpha)*sin(gama) + cos(gama)*sin(alpha)*sin(beta)))/2),2) - 1600;
	
	//输出Fi 
	// for(i=0;i<6;i++)
	// {
	// 	printf("%f.3\n",Fi[i]); 	
	// }

	sum = 0;
